INSERT INTO `vimkid_article` VALUES (1,1,1,'README\n===========================\n该文件用来测试和展示书写README的各种markdown语法。GitHub的markdown语法在标准的markdown语法基础上做了扩充，称之为`GitHub Flavored Markdown`。简称`GFM`，GFM在GitHub上有广泛应用，除了README文件外，issues和wiki均支持markdown语法。\n\n****\n###　　　　　　　　　　　　Author:Jelly\n###　　　　　　　　　 E-mail:879231132@qq.com\n\n===========================\n\n\n\n##<a name=\"index\"/>目录\n* [横线](#line)\n* [标题](#title)\n* [文本](#text)\n    * 普通文本\n    * 单行文本\n    * 多行文本\n    * 文字高亮\n* [链接](#link) \n    * 文字超链接\n        *  链接外部URL\n        *  链接本仓库里的URL\n    *  锚点\n    * [图片超链接](#piclink)\n* [图片](#pic)\n    * 来源于网络的图片\n    * GitHub仓库中的图片\n* [列表](#dot)\n    * 圆点列表\n    * 数字列表\n    * 复选框列表\n* [块引用](#blockquotes)\n* [代码](#code)\n* [表格](#table) \n* [表情](#emoji)\n\n<a name=\"line\"/>\n##***、---、___显示虚横线\n***\n---\n___\n\n\n\n<a name=\"title\"/>\n#一级标题\n##二级标题\n###三级标题\n####四级标题\n#####五级标题\n######六级标题\n\n\n##<a name=\"text\"/>显示文本\n###普通文本\n这是一段普通的文本\n####关于换行\n直接回车不能换行，<br>\n可以使用<br>。\n但是使用html标签就丧失了markdown的意义。  \n可以在上一行文本后面补两个空格，  \n这样下一行的文本就换行了。\n\n或者就是在两行文本直接加一个空行。\n\n也能实现换行效果，不过这个行间距有点大。\n###单行文本\n    Hello,大家好，我是果冻虾仁。\n###文本块\n    欢迎到访\n    很高兴见到您\n    祝您，早上好，中午好，下午好，晚安\n###部分文字高亮\nThank `You` . Please `Call` Me `Coder`\n####高亮功能更适合做一篇文章的tag\n例如:<br>\n`java` `网络编程` `Socket` `全双工`\n####删除线\n这是一个 ~~删除线~~\n####斜体\n*斜体1*\n\n_斜体2_\n####粗体\n**粗体1**\n\n__粗体2__\n\n####组合使用粗体、斜体和删除线\n***斜粗体1***\n\n___斜粗体2___\n\n***~~斜粗体删除线1~~***\n\n~~***斜粗体删除线2***~~\n\n##<a name=\"link\"/>链接\n###链接外部URL\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")   语法如下：\n```\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")\n```\n###链接的另一种写法\n[我的博客][id]  \n\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"   \n语法如下：\n```\n[我的博客][id]\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"\n```\n中括号[ ]里的id，可以是数字，字母等的组合。这两行可以不连着写，**一般把第二行的链接统一放在文章末尾**，id上下对应就行了。这样正文看起来会比较干净。\n\n###链接本仓库里的URL\n[Book](./Book)\n语法如下：\n```\n[Book](./Book)\n```\n如果文件要引用的文件不存在，则待点击的文本为红色。引用的文件存在存在则文本为蓝色。\n###锚点\n我们可以使用HTML的锚点标签（`#`）来设置锚点：[回到目录](#index)  \n但其实呢，每一个标题都是一个锚点，不需要用标签来指定，比如我们 [回到顶部](#TEST)\n不过不幸的是，由于对中文支持的不好，所以中文标题貌似是不能视作标签的。\n\n##<a name=\"pic\"/>显示图片\n###来源于网络的图片\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\")\n![](https://assets-cdn.github.com/images/modules/contact/goldstar.gif)\n\n###GitHub仓库中的图片\n![](https://github.com/guodongxiaren/ImageCache/raw/master/Logo/foryou.gif)\n###<a name=\"piclink\">给图片加上超链接\n####第一种\n\n[![head]](http://blog.csdn.net/guodongxiaren/article/details/23690801)\n[head]:https://github.com/guodongxiaren/ImageCache/raw/master/Logo/jianxin.jpg \"点击图片进入我的博客\"\n\n#### 第二种\n[![内容任意](http://www.baidu.com/img/bdlogo.gif \"百度logo\")](http://www.baidu.com)\n\n\n\n\n##<a name=\"dot\"/>列表\n###圆点列表\n* 昵称：果冻虾仁\n* 别名：隔壁老王\n* 英文名：Jelly\n\n###更多圆点\n* 编程语言\n    * 脚本语言\n        * Python\n\n###数字列表\n####一般效果\n就是在数字后面加一个点，再加一个空格。不过看起来起来可能不够明显。    \n面向对象的三个基本特征：\n\n1. 封装\n2. 继承\n3. 多态\n\n####数字列表自动排序\n也可以在第一行指定`1. `，而接下来的几行用星号`*`（或者继续用数字1. ）就可以了，它会自动显示成2、3、4……。    \n面向对象的七大原则：\n\n1. 开闭原则\n* 里氏转换原则\n* 依赖倒转原则\n* 接口隔离原则\n* 组合/聚合复用原则\n* “迪米特”法则\n* 单一直则原则\n\n####多级数字列表\n和圆点的列表一样，数字列表也有多级结构：  \n\n1. 这是一级的数字列表，数字1还是1\n   1. 这是二级的数字列表，阿拉伯数字在显示的时候变成了罗马数字\n      1. 这是三级的数字列表，数字在显示的时候变成了英文字母\n\t    1. 四级的数字列表显示效果，就不再变化了，依旧是英文字母\n\n### 复选框列表\n- [x] C\n- [x] C++\n- [x] Java\n- [x] Qt\n- [x] Android\n- [ ] C#\n- [ ] .NET\n\n您可以使用这个功能来标注某个项目各项任务的完成情况。\n##<a name=\"blockquotes\"/>块引用\n\n###常用于引用文本\n####文本摘自《深入理解计算机系统》P27\n　令人吃惊的是，在哪种字节顺序是合适的这个问题上，人们表现得非常情绪化。实际上术语“little endian”（小端）和“big endian”（大端）出自Jonathan Swift的《格利佛游记》一书，其中交战的两个派别无法就应该从哪一端打开一个半熟的鸡蛋达成一致。因此，争论沦为关于社会政治的争论。只要选择了一种规则并且始终如一的坚持，其实对于哪种字节排序的选择都是任意的。\n><b>“端”（endian）的起源</b><br>\n以下是Jonathan Swift在1726年关于大小端之争历史的描述：<br>\n“……下面我要告诉你的是，Lilliput和Blefuscu这两大强国在过去36个月里一直在苦战。战争开始是由于以下的原因：我们大家都认为，吃鸡蛋前，原始的方法是打破鸡蛋较大的一端，可是当今的皇帝的祖父小时候吃鸡蛋，一次按古法打鸡蛋时碰巧将一个手指弄破了，因此他的父亲，当时的皇帝，就下了一道敕令，命令全体臣民吃鸡蛋时打破较小的一端，违令者重罚。”\n\n###块引用有多级结构\n>数据结构\n>>树\n>>>二叉树\n>>>>平衡二叉树\n>>>>>满二叉树\n\n##<a name=\"code\"/>代码高亮\n```Java\npublic static void main(String[]args){} //Java\n```\n```c\nint main(int argc, char *argv[]) //C\n```\n```Bash\necho \"hello GitHub\"#Bash\n```\n```javascript\ndocument.getElementById(\"myH1\").innerHTML=\"Welcome to my Homepage\"; //javascipt\n```\n```cpp\nstring &operator+(const string& A,const string& B) //cpp\n```\n##<a name=\"table\"/>显示表格\n表头1  | 表头2\n------------- | -------------\nContent Cell  | Content Cell\nContent Cell  | Content Cell\n\n| 表头1  | 表头2|\n| ------------- | ------------- |\n| Content Cell  | Content Cell  |\n| Content Cell  | Content Cell  |\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | Display the help window.|\n| Close     | Closes a window     |\n\n表格中也可以使用普通文本的删除线，斜体等效果\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | ~~Display the~~ help window.|\n| Close     | _Closes_ a window     |\n\n表格可以指定对齐方式\n\n| 左对齐 | 居中  | 右对齐 |\n| :------------ |:---------------:| -----:|\n| col 3 is      | some wordy text | $1600 |\n| col 2 is      | centered        |   $12 |\n| zebra stripes | are neat        |    $1 |\n\n表格中嵌入图片\n\n| 图片 | 描述 |\n| ---- | ---- |\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\") | baidu\n\n##<a name=\"emoji\"/>添加表情\nGithub的Markdown语法支持添加emoji表情，输入不同的符号码（两个冒号包围的字符）可以显示出不同的表情。\n\n比如`:blush:`，可以显示:blush:。\n\n具体每一个表情的符号码，可以查询GitHub的官方网页[http://www.emoji-cheat-sheet.com](http://www.emoji-cheat-sheet.com)。\n\n但是这个网页每次都打开**奇慢**。。所以我整理到了本repo中，大家可以直接在此查看[emoji](./emoji.md)。','content','title1',1463219075,'2016-05-14',1463279075,'2016-05-14','vimkid',1,'',0,'seotitle','keywords','description',0,'vimkid website',1,'seosubtitle',0,999,NULL,NULL,0,0),(2,1,1,'###vim最最基本的使用\n\n####五星级常用命令\n\n    :wq     # 保存退出\n    :w       # 保存但不退出\n    i          # 进入插入模式\n    esc     # 进入普通模式\n    kjhl     # 上下左右移动\n    v         # 进入视图模式\n    /         # 进入查找模式\n    u        # 撤销操作\n　\n　\n####四星级常用命令\n    w    # 向后移动1个单词到词首\n\n\t\n    \n\n','content','vim最最基本的使用',1468076343,'2016-07-09',1468076343,'2016-07-09','vimkid',1,'',0,'vim最最基本使用','keywords','vim最基本使用',0,'vimkid website',1,'seosubtitle',0,1,NULL,NULL,0,0),(3,1,1,'```javascript\n$(function(){\n\t  $(\"div\").html(\"I am a div2.\");\n});\n```\n```java\npublic static void main(String[]args){} //Java\n```\n```c\nint main(int argc, char *argv[]) //C\n```\n```bash\necho \"hello GitHub\"#Bash\n```\n```javascript\ndocument.getElementById(\"myH1\").innerHTML=\"Welcome to my Homepage\"; //javascipt\n```\n```cpp\nstring &operator+(const string& A,const string& B) //cpp\n```\n##README\n###　　Author:Jelly\n### E-mail:879231132@qq.com\n\n##目录\n* [横线](#line)\n* [标题](#title)\n* [文本](#text)\n    * 普通文本\n    * 单行文本\n    * 多行文本\n    * 文字高亮\n* [链接](#link) \n    * 文字超链接\n        *  链接外部URL\n        *  链接本仓库里的URL\n    *  锚点\n    * [图片超链接](#piclink)\n* [图片](#pic)\n    * 来源于网络的图片\n    * GitHub仓库中的图片\n* [列表](#dot)\n    * 圆点列表\n    * 数字列表\n    * 复选框列表\n* [块引用](#blockquotes)\n* [代码](#code)\n* [表格](#table) \n* [表情](#emoji)\n\n##***、---、___显示虚横线\n***\n---\n___\n\n#一级标题\n##二级标题\n###三级标题\n####四级标题\n#####五级标题\n######六级标题\n\n\n##显示文本\n###普通文本\n这是一段普通的文本\n####关于换行\n直接回车不能换行，<br>\n可以使用\\<br>。\n但是使用html标签就丧失了markdown的意义。  \n可以在上一行文本后面补两个空格，  \n这样下一行的文本就换行了。\n\n或者就是在两行文本直接加一个空行。\n\n也能实现换行效果，不过这个行间距有点大。\n###单行文本\n    Hello,大家好，我是果冻虾仁。\n###文本块\n    欢迎到访\n    很高兴见到您\n    祝您，早上好，中午好，下午好，晚安\n###部分文字高亮\nThank `You` . Please `Call` Me `Coder`\n####高亮功能更适合做一篇文章的tag\n例如:<br>\n`java` `网络编程` `Socket` `全双工`\n####删除线\n这是一个 ~~删除线~~\n####斜体\n*斜体1*\n\n_斜体2_\n####粗体\n**粗体1**\n\n__粗体2__\n\n####组合使用粗体、斜体和删除线\n***斜粗体1***\n\n___斜粗体2___\n\n***~~斜粗体删除线1~~***\n\n~~***斜粗体删除线2***~~\n\n##链接\n###链接外部URL\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")   语法如下：\n```\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")\n```\n###链接的另一种写法\n[我的博客][id]  \n\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示234\"   \n\n语法如下111：\n```\n[我的博客][id]\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示23423\"\nhello lkj ;lkjasdf;lksajpoiuwe;lkjasdf;lkjsa;dlkfj;asldkfj;aslkdfj;aslkdjf\n\n```\n中括号[ ]里的id，可以是数字，字母等的组合。这两行可以不连着写，**一般把第二行的链接统一放在文章末尾**，id上下对应就行了。这样正文看起来会比较干净。\n\n###链接本仓库里的URL\n[Book](./Book)\n语法如下：\n```\n[Book](./Book)\n```\n如果文件要引用的文件不存在，则待点击的文本为红色。引用的文件存在存在则文本为蓝色。\n###锚点\n我们可以使用HTML的锚点标签（`#`）来设置锚点：[回到目录](#index)  \n但其实呢，每一个标题都是一个锚点，不需要用标签来指定，比如我们 [回到顶部](#TEST)\n不过不幸的是，由于对中文支持的不好，所以中文标题貌似是不能视作标签的。\n\n##显示图片\n###来源于网络的图片\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\")\n![](https://assets-cdn.github.com/images/modules/contact/goldstar.gif)\n\n###GitHub仓库中的图片\n![](https://github.com/guodongxiaren/ImageCache/raw/master/Logo/foryou.gif)\n###给图片加上超链接\n####第一种\n\n[![head]](http://blog.csdn.net/guodongxiaren/article/details/23690801)\n[head]:https://github.com/guodongxiaren/ImageCache/raw/master/Logo/jianxin.jpg \"点击图片进入我的博客\"\n\n#### 第二种\n[![内容任意](http://www.baidu.com/img/bdlogo.gif \"百度logo\")](http://www.baidu.com)\n\n\n\n\n##列表\n###圆点列表\n* 昵称：果冻虾仁\n* 别名：隔壁老王\n* 英文名：Jelly\n\n###更多圆点\n* 编程语言\n    * 脚本语言\n        * Python\n\n###数字列表\n####一般效果\n就是在数字后面加一个点，再加一个空格。不过看起来起来可能不够明显。    \n面向对象的三个基本特征：\n\n1. 封装\n2. 继承\n3. 多态\n\n####数字列表自动排序\n也可以在第一行指定`1. `，而接下来的几行用星号`*`（或者继续用数字1. ）就可以了，它会自动显示成2、3、4……。    \n面向对象的七大原则：\n\n1. 开闭原则\n* 里氏转换原则\n* 依赖倒转原则\n* 接口隔离原则\n* 组合/聚合复用原则\n* “迪米特”法则\n* 单一直则原则\n\n####多级数字列表\n和圆点的列表一样，数字列表也有多级结构：  \n\n1. 这是一级的数字列表，数字1还是1\n   1. 这是二级的数字列表，阿拉伯数字在显示的时候变成了罗马数字\n      1. 这是三级的数字列表，数字在显示的时候变成了英文字母\n\t    1. 四级的数字列表显示效果，就不再变化了，依旧是英文字母\n\n### 复选框列表\n- [x] C\n- [x] C++\n- [x] Java\n- [x] Qt\n- [x] Android\n- [ ] C#\n- [ ] .NET\n\n您可以使用这个功能来标注某个项目各项任务的完成情况。\n##块引用\n\n###常用于引用文本\n####文本摘自《深入理解计算机系统》P27\n　令人吃惊的是，在哪种字节顺序是合适的这个问题上，人们表现得非常情绪化。实际上术语“little endian”（小端）和“big endian”（大端）出自Jonathan Swift的《格利佛游记》一书，其中交战的两个派别无法就应该从哪一端打开一个半熟的鸡蛋达成一致。因此，争论沦为关于社会政治的争论。只要选择了一种规则并且始终如一的坚持，其实对于哪种字节排序的选择都是任意的。\n><b>“端”（endian）的起源</b><br>\n以下是Jonathan Swift在1726年关于大小端之争历史的描述：<br>\n“……下面我要告诉你的是，Lilliput和Blefuscu这两大强国在过去36个月里一直在苦战。战争开始是由于以下的原因：我们大家都认为，吃鸡蛋前，原始的方法是打破鸡蛋较大的一端，可是当今的皇帝的祖父小时候吃鸡蛋，一次按古法打鸡蛋时碰巧将一个手指弄破了，因此他的父亲，当时的皇帝，就下了一道敕令，命令全体臣民吃鸡蛋时打破较小的一端，违令者重罚。”\n\n###块引用有多级结构\n>数据结构\n>>树\n>>>二叉树\n>>>>平衡二叉树\n>>>>>满二叉树\n\n##代码高亮\n```javascript\n$(function(){\n\t  $(\"div\").html(\"I am a div.\");\n});\n```\n```java\npublic static void main(String[]args){} //Java\n```\n```c\nint main(int argc, char *argv[]) //C\n```\n```bash\necho \"hello GitHub\"#Bash\n```\n```javascript\ndocument.getElementById(\"myH1\").innerHTML=\"Welcome to my Homepage\"; //javascipt\n```\n```cpp\nstring &operator+(const string& A,const string& B) //cpp\n```\n##显示表格\n\n表头1  | 表头2\n------------- | -------------\nContent Cell  | Content Cell\nContent Cell  | Content Cell\n\n\n\n| 表头1  | 表头2|\n| ------------- | ------------- |\n| Content Cell  | Content Cell  |\n| Content Cell  | Content Cell  |\n\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | Display the help window.|\n| Close     | Closes a window     |\n\n表格中也可以使用普通文本的删除线，斜体等效果\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | ~~Display the~~ help window.|\n| Close     | _Closes_ a window     |\n\n表格可以指定对齐方式\n\n| 左对齐 | 居中  | 右对齐 |\n| :------------ |:---------------:| -----:|\n| col 3 is      | some wordy text | $1600 |\n| col 2 is      | centered        |   $12 |\n| zebra stripes | are neat        |    $1 |\n\n表格中嵌入图片\n\n| 图片 | 描述 |\n| ---- | ---- |\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\") | baidu\n\n##添加表情\nGithub的Markdown语法支持添加emoji表情，输入不同的符号码（两个冒号包围的字符）可以显示出不同的表情。\n\n比如`:blush:`，可以显示:blush:。\n\n具体每一个表情的符号码，可以查询GitHub的官方网页[http://www.emoji-cheat-sheet.com](http://www.emoji-cheat-sheet.com)。\n\n但是这个网页每次都打开**奇慢**。。所以我整理到了本repo中，大家可以直接在此查看[emoji](./emoji.md)。\n\'','content','title3',1463179630,'2016-05-14',1463279630,'2016-05-14','vimkid',1,'',0,'seotitle','keywords','description',0,'vimkid website',1,'seosubtitle',0,999,NULL,NULL,0,0),(4,1,1,'README\n===========================\n该文件用来测试和展示书写README的各种markdown语法。GitHub的markdown语法在标准的markdown语法基础上做了扩充，称之为`GitHub Flavored Markdown`。简称`GFM`，GFM在GitHub上有广泛应用，除了README文件外，issues和wiki均支持markdown语法。\n\n****\n###　　　　　　　　　　　　Author:Jelly\n###　　　　　　　　　 E-mail:879231132@qq.com\n\n===========================\n\n\n\n##<a name=\"index\"/>目录\n* [横线](#line)\n* [标题](#title)\n* [文本](#text)\n    * 普通文本\n    * 单行文本\n    * 多行文本\n    * 文字高亮\n* [链接](#link) \n    * 文字超链接\n        *  链接外部URL\n        *  链接本仓库里的URL\n    *  锚点\n    * [图片超链接](#piclink)\n* [图片](#pic)\n    * 来源于网络的图片\n    * GitHub仓库中的图片\n* [列表](#dot)\n    * 圆点列表\n    * 数字列表\n    * 复选框列表\n* [块引用](#blockquotes)\n* [代码](#code)\n* [表格](#table) \n* [表情](#emoji)\n\n<a name=\"line\"/>\n##***、---、___显示虚横线\n***\n---\n___\n\n\n\n<a name=\"title\"/>\n#一级标题\n##二级标题\n###三级标题\n####四级标题\n#####五级标题\n######六级标题\n\n\n##<a name=\"text\"/>显示文本\n###普通文本\n这是一段普通的文本\n####关于换行\n直接回车不能换行，<br>\n可以使用<br>。\n但是使用html标签就丧失了markdown的意义。  \n可以在上一行文本后面补两个空格，  \n这样下一行的文本就换行了。\n\n或者就是在两行文本直接加一个空行。\n\n也能实现换行效果，不过这个行间距有点大。\n###单行文本\n    Hello,大家好，我是果冻虾仁。\n###文本块\n    欢迎到访\n    很高兴见到您\n    祝您，早上好，中午好，下午好，晚安\n###部分文字高亮\nThank `You` . Please `Call` Me `Coder`\n####高亮功能更适合做一篇文章的tag\n例如:<br>\n`java` `网络编程` `Socket` `全双工`\n####删除线\n这是一个 ~~删除线~~\n####斜体\n*斜体1*\n\n_斜体2_\n####粗体\n**粗体1**\n\n__粗体2__\n\n####组合使用粗体、斜体和删除线\n***斜粗体1***\n\n___斜粗体2___\n\n***~~斜粗体删除线1~~***\n\n~~***斜粗体删除线2***~~\n\n##<a name=\"link\"/>链接\n###链接外部URL\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")   语法如下：\n```\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")\n```\n###链接的另一种写法\n[我的博客][id]  \n\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"   \n语法如下：\n```\n[我的博客][id]\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"\n```\n中括号[ ]里的id，可以是数字，字母等的组合。这两行可以不连着写，**一般把第二行的链接统一放在文章末尾**，id上下对应就行了。这样正文看起来会比较干净。\n\n###链接本仓库里的URL\n[Book](./Book)\n语法如下：\n```\n[Book](./Book)\n```\n如果文件要引用的文件不存在，则待点击的文本为红色。引用的文件存在存在则文本为蓝色。\n###锚点\n我们可以使用HTML的锚点标签（`#`）来设置锚点：[回到目录](#index)  \n但其实呢，每一个标题都是一个锚点，不需要用标签来指定，比如我们 [回到顶部](#TEST)\n不过不幸的是，由于对中文支持的不好，所以中文标题貌似是不能视作标签的。\n\n##<a name=\"pic\"/>显示图片\n###来源于网络的图片\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\")\n![](https://assets-cdn.github.com/images/modules/contact/goldstar.gif)\n\n###GitHub仓库中的图片\n![](https://github.com/guodongxiaren/ImageCache/raw/master/Logo/foryou.gif)\n###<a name=\"piclink\">给图片加上超链接\n####第一种\n\n[![head]](http://blog.csdn.net/guodongxiaren/article/details/23690801)\n[head]:https://github.com/guodongxiaren/ImageCache/raw/master/Logo/jianxin.jpg \"点击图片进入我的博客\"\n\n#### 第二种\n[![内容任意](http://www.baidu.com/img/bdlogo.gif \"百度logo\")](http://www.baidu.com)\n\n\n\n\n##<a name=\"dot\"/>列表\n###圆点列表\n* 昵称：果冻虾仁\n* 别名：隔壁老王\n* 英文名：Jelly\n\n###更多圆点\n* 编程语言\n    * 脚本语言\n        * Python\n\n###数字列表\n####一般效果\n就是在数字后面加一个点，再加一个空格。不过看起来起来可能不够明显。    \n面向对象的三个基本特征：\n\n1. 封装\n2. 继承\n3. 多态\n\n####数字列表自动排序\n也可以在第一行指定`1. `，而接下来的几行用星号`*`（或者继续用数字1. ）就可以了，它会自动显示成2、3、4……。    \n面向对象的七大原则：\n\n1. 开闭原则\n* 里氏转换原则\n* 依赖倒转原则\n* 接口隔离原则\n* 组合/聚合复用原则\n* “迪米特”法则\n* 单一直则原则\n\n####多级数字列表\n和圆点的列表一样，数字列表也有多级结构：  \n\n1. 这是一级的数字列表，数字1还是1\n   1. 这是二级的数字列表，阿拉伯数字在显示的时候变成了罗马数字\n      1. 这是三级的数字列表，数字在显示的时候变成了英文字母\n\t    1. 四级的数字列表显示效果，就不再变化了，依旧是英文字母\n\n### 复选框列表\n- [x] C\n- [x] C++\n- [x] Java\n- [x] Qt\n- [x] Android\n- [ ] C#\n- [ ] .NET\n\n您可以使用这个功能来标注某个项目各项任务的完成情况。\n##<a name=\"blockquotes\"/>块引用\n\n###常用于引用文本\n####文本摘自《深入理解计算机系统》P27\n　令人吃惊的是，在哪种字节顺序是合适的这个问题上，人们表现得非常情绪化。实际上术语“little endian”（小端）和“big endian”（大端）出自Jonathan Swift的《格利佛游记》一书，其中交战的两个派别无法就应该从哪一端打开一个半熟的鸡蛋达成一致。因此，争论沦为关于社会政治的争论。只要选择了一种规则并且始终如一的坚持，其实对于哪种字节排序的选择都是任意的。\n><b>“端”（endian）的起源</b><br>\n以下是Jonathan Swift在1726年关于大小端之争历史的描述：<br>\n“……下面我要告诉你的是，Lilliput和Blefuscu这两大强国在过去36个月里一直在苦战。战争开始是由于以下的原因：我们大家都认为，吃鸡蛋前，原始的方法是打破鸡蛋较大的一端，可是当今的皇帝的祖父小时候吃鸡蛋，一次按古法打鸡蛋时碰巧将一个手指弄破了，因此他的父亲，当时的皇帝，就下了一道敕令，命令全体臣民吃鸡蛋时打破较小的一端，违令者重罚。”\n\n###块引用有多级结构\n>数据结构\n>>树\n>>>二叉树\n>>>>平衡二叉树\n>>>>>满二叉树\n\n##<a name=\"code\"/>代码高亮\n```Java\npublic static void main(String[]args){} //Java\n```\n```c\nint main(int argc, char *argv[]) //C\n```\n```Bash\necho \"hello GitHub\"#Bash\n```\n```javascript\ndocument.getElementById(\"myH1\").innerHTML=\"Welcome to my Homepage\"; //javascipt\n```\n```cpp\nstring &operator+(const string& A,const string& B) //cpp\n```\n##<a name=\"table\"/>显示表格\n表头1  | 表头2\n------------- | -------------\nContent Cell  | Content Cell\nContent Cell  | Content Cell\n\n| 表头1  | 表头2|\n| ------------- | ------------- |\n| Content Cell  | Content Cell  |\n| Content Cell  | Content Cell  |\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | Display the help window.|\n| Close     | Closes a window     |\n\n表格中也可以使用普通文本的删除线，斜体等效果\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | ~~Display the~~ help window.|\n| Close     | _Closes_ a window     |\n\n表格可以指定对齐方式\n\n| 左对齐 | 居中  | 右对齐 |\n| :------------ |:---------------:| -----:|\n| col 3 is      | some wordy text | $1600 |\n| col 2 is      | centered        |   $12 |\n| zebra stripes | are neat        |    $1 |\n\n表格中嵌入图片\n\n| 图片 | 描述 |\n| ---- | ---- |\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\") | baidu\n\n##<a name=\"emoji\"/>添加表情\nGithub的Markdown语法支持添加emoji表情，输入不同的符号码（两个冒号包围的字符）可以显示出不同的表情。\n\n比如`:blush:`，可以显示:blush:。\n\n具体每一个表情的符号码，可以查询GitHub的官方网页[http://www.emoji-cheat-sheet.com](http://www.emoji-cheat-sheet.com)。\n\n但是这个网页每次都打开**奇慢**。。所以我整理到了本repo中，大家可以直接在此查看[emoji](./emoji.md)。','content','4',1463279631,'2016-05-15',1463279631,'2016-05-15','vimkid',1,'',0,'seotitle','keywords','description',0,'vimkid website',1,'seosubtitle',0,999,NULL,NULL,0,0),(5,1,1,'README\n===========================\n该文件用来测试和展示书写README的各种markdown语法。GitHub的markdown语法在标准的markdown语法基础上做了扩充，称之为`GitHub Flavored Markdown`。简称`GFM`，GFM在GitHub上有广泛应用，除了README文件外，issues和wiki均支持markdown语法。\n\n****\n###　　　　　　　　　　　　Author:Jelly\n###　　　　　　　　　 E-mail:879231132@qq.com\n\n===========================\n\n\n\n##<a name=\"index\"/>目录\n* [横线](#line)\n* [标题](#title)\n* [文本](#text)\n    * 普通文本\n    * 单行文本\n    * 多行文本\n    * 文字高亮\n* [链接](#link) \n    * 文字超链接\n        *  链接外部URL\n        *  链接本仓库里的URL\n    *  锚点\n    * [图片超链接](#piclink)\n* [图片](#pic)\n    * 来源于网络的图片\n    * GitHub仓库中的图片\n* [列表](#dot)\n    * 圆点列表\n    * 数字列表\n    * 复选框列表\n* [块引用](#blockquotes)\n* [代码](#code)\n* [表格](#table) \n* [表情](#emoji)\n\n<a name=\"line\"/>\n##***、---、___显示虚横线\n***\n---\n___\n\n\n\n<a name=\"title\"/>\n#一级标题\n##二级标题\n###三级标题\n####四级标题\n#####五级标题\n######六级标题\n\n\n##<a name=\"text\"/>显示文本\n###普通文本\n这是一段普通的文本\n####关于换行\n直接回车不能换行，<br>\n可以使用<br>。\n但是使用html标签就丧失了markdown的意义。  \n可以在上一行文本后面补两个空格，  \n这样下一行的文本就换行了。\n\n或者就是在两行文本直接加一个空行。\n\n也能实现换行效果，不过这个行间距有点大。\n###单行文本\n    Hello,大家好，我是果冻虾仁。\n###文本块\n    欢迎到访\n    很高兴见到您\n    祝您，早上好，中午好，下午好，晚安\n###部分文字高亮\nThank `You` . Please `Call` Me `Coder`\n####高亮功能更适合做一篇文章的tag\n例如:<br>\n`java` `网络编程` `Socket` `全双工`\n####删除线\n这是一个 ~~删除线~~\n####斜体\n*斜体1*\n\n_斜体2_\n####粗体\n**粗体1**\n\n__粗体2__\n\n####组合使用粗体、斜体和删除线\n***斜粗体1***\n\n___斜粗体2___\n\n***~~斜粗体删除线1~~***\n\n~~***斜粗体删除线2***~~\n\n##<a name=\"link\"/>链接\n###链接外部URL\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")   语法如下：\n```\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")\n```\n###链接的另一种写法\n[我的博客][id]  \n\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"   \n语法如下：\n```\n[我的博客][id]\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"\n```\n中括号[ ]里的id，可以是数字，字母等的组合。这两行可以不连着写，**一般把第二行的链接统一放在文章末尾**，id上下对应就行了。这样正文看起来会比较干净。\n\n###链接本仓库里的URL\n[Book](./Book)\n语法如下：\n```\n[Book](./Book)\n```\n如果文件要引用的文件不存在，则待点击的文本为红色。引用的文件存在存在则文本为蓝色。\n###锚点\n我们可以使用HTML的锚点标签（`#`）来设置锚点：[回到目录](#index)  \n但其实呢，每一个标题都是一个锚点，不需要用标签来指定，比如我们 [回到顶部](#TEST)\n不过不幸的是，由于对中文支持的不好，所以中文标题貌似是不能视作标签的。\n\n##<a name=\"pic\"/>显示图片\n###来源于网络的图片\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\")\n![](https://assets-cdn.github.com/images/modules/contact/goldstar.gif)\n\n###GitHub仓库中的图片\n![](https://github.com/guodongxiaren/ImageCache/raw/master/Logo/foryou.gif)\n###<a name=\"piclink\">给图片加上超链接\n####第一种\n\n[![head]](http://blog.csdn.net/guodongxiaren/article/details/23690801)\n[head]:https://github.com/guodongxiaren/ImageCache/raw/master/Logo/jianxin.jpg \"点击图片进入我的博客\"\n\n#### 第二种\n[![内容任意](http://www.baidu.com/img/bdlogo.gif \"百度logo\")](http://www.baidu.com)\n\n\n\n\n##<a name=\"dot\"/>列表\n###圆点列表\n* 昵称：果冻虾仁\n* 别名：隔壁老王\n* 英文名：Jelly\n\n###更多圆点\n* 编程语言\n    * 脚本语言\n        * Python\n\n###数字列表\n####一般效果\n就是在数字后面加一个点，再加一个空格。不过看起来起来可能不够明显。    \n面向对象的三个基本特征：\n\n1. 封装\n2. 继承\n3. 多态\n\n####数字列表自动排序\n也可以在第一行指定`1. `，而接下来的几行用星号`*`（或者继续用数字1. ）就可以了，它会自动显示成2、3、4……。    \n面向对象的七大原则：\n\n1. 开闭原则\n* 里氏转换原则\n* 依赖倒转原则\n* 接口隔离原则\n* 组合/聚合复用原则\n* “迪米特”法则\n* 单一直则原则\n\n####多级数字列表\n和圆点的列表一样，数字列表也有多级结构：  \n\n1. 这是一级的数字列表，数字1还是1\n   1. 这是二级的数字列表，阿拉伯数字在显示的时候变成了罗马数字\n      1. 这是三级的数字列表，数字在显示的时候变成了英文字母\n\t    1. 四级的数字列表显示效果，就不再变化了，依旧是英文字母\n\n### 复选框列表\n- [x] C\n- [x] C++\n- [x] Java\n- [x] Qt\n- [x] Android\n- [ ] C#\n- [ ] .NET\n\n您可以使用这个功能来标注某个项目各项任务的完成情况。\n##<a name=\"blockquotes\"/>块引用\n\n###常用于引用文本\n####文本摘自《深入理解计算机系统》P27\n　令人吃惊的是，在哪种字节顺序是合适的这个问题上，人们表现得非常情绪化。实际上术语“little endian”（小端）和“big endian”（大端）出自Jonathan Swift的《格利佛游记》一书，其中交战的两个派别无法就应该从哪一端打开一个半熟的鸡蛋达成一致。因此，争论沦为关于社会政治的争论。只要选择了一种规则并且始终如一的坚持，其实对于哪种字节排序的选择都是任意的。\n><b>“端”（endian）的起源</b><br>\n以下是Jonathan Swift在1726年关于大小端之争历史的描述：<br>\n“……下面我要告诉你的是，Lilliput和Blefuscu这两大强国在过去36个月里一直在苦战。战争开始是由于以下的原因：我们大家都认为，吃鸡蛋前，原始的方法是打破鸡蛋较大的一端，可是当今的皇帝的祖父小时候吃鸡蛋，一次按古法打鸡蛋时碰巧将一个手指弄破了，因此他的父亲，当时的皇帝，就下了一道敕令，命令全体臣民吃鸡蛋时打破较小的一端，违令者重罚。”\n\n###块引用有多级结构\n>数据结构\n>>树\n>>>二叉树\n>>>>平衡二叉树\n>>>>>满二叉树\n\n##<a name=\"code\"/>代码高亮\n```Java\npublic static void main(String[]args){} //Java\n```\n```c\nint main(int argc, char *argv[]) //C\n```\n```Bash\necho \"hello GitHub\"#Bash\n```\n```javascript\ndocument.getElementById(\"myH1\").innerHTML=\"Welcome to my Homepage\"; //javascipt\n```\n```cpp\nstring &operator+(const string& A,const string& B) //cpp\n```\n##<a name=\"table\"/>显示表格\n表头1  | 表头2\n------------- | -------------\nContent Cell  | Content Cell\nContent Cell  | Content Cell\n\n| 表头1  | 表头2|\n| ------------- | ------------- |\n| Content Cell  | Content Cell  |\n| Content Cell  | Content Cell  |\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | Display the help window.|\n| Close     | Closes a window     |\n\n表格中也可以使用普通文本的删除线，斜体等效果\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | ~~Display the~~ help window.|\n| Close     | _Closes_ a window     |\n\n表格可以指定对齐方式\n\n| 左对齐 | 居中  | 右对齐 |\n| :------------ |:---------------:| -----:|\n| col 3 is      | some wordy text | $1600 |\n| col 2 is      | centered        |   $12 |\n| zebra stripes | are neat        |    $1 |\n\n表格中嵌入图片\n\n| 图片 | 描述 |\n| ---- | ---- |\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\") | baidu\n\n##<a name=\"emoji\"/>添加表情\nGithub的Markdown语法支持添加emoji表情，输入不同的符号码（两个冒号包围的字符）可以显示出不同的表情。\n\n比如`:blush:`，可以显示:blush:。\n\n具体每一个表情的符号码，可以查询GitHub的官方网页[http://www.emoji-cheat-sheet.com](http://www.emoji-cheat-sheet.com)。\n\n但是这个网页每次都打开**奇慢**。。所以我整理到了本repo中，大家可以直接在此查看[emoji](./emoji.md)。','content','title5',1461279632,'2016-04-22',1463279632,'2016-04-22','vimkid',1,'',0,'seotitle','keywords','description',0,'vimkid website',1,'seosubtitle',0,999,NULL,NULL,0,0),(6,1,1,'README\n===========================\n该文件用来测试和展示书写README的各种markdown语法。GitHub的markdown语法在标准的markdown语法基础上做了扩充，称之为`GitHub Flavored Markdown`。简称`GFM`，GFM在GitHub上有广泛应用，除了README文件外，issues和wiki均支持markdown语法。\n\n****\n###　　　　　　　　　　　　Author:Jelly\n###　　　　　　　　　 E-mail:879231132@qq.com\n\n===========================\n\n\n\n##<a name=\"index\"/>目录\n* [横线](#line)\n* [标题](#title)\n* [文本](#text)\n    * 普通文本\n    * 单行文本\n    * 多行文本\n    * 文字高亮\n* [链接](#link) \n    * 文字超链接\n        *  链接外部URL\n        *  链接本仓库里的URL\n    *  锚点\n    * [图片超链接](#piclink)\n* [图片](#pic)\n    * 来源于网络的图片\n    * GitHub仓库中的图片\n* [列表](#dot)\n    * 圆点列表\n    * 数字列表\n    * 复选框列表\n* [块引用](#blockquotes)\n* [代码](#code)\n* [表格](#table) \n* [表情](#emoji)\n\n<a name=\"line\"/>\n##***、---、___显示虚横线\n***\n---\n___\n\n\n\n<a name=\"title\"/>\n#一级标题\n##二级标题\n###三级标题\n####四级标题\n#####五级标题\n######六级标题\n\n\n##<a name=\"text\"/>显示文本\n###普通文本\n这是一段普通的文本\n####关于换行\n直接回车不能换行，<br>\n可以使用<br>。\n但是使用html标签就丧失了markdown的意义。  \n可以在上一行文本后面补两个空格，  \n这样下一行的文本就换行了。\n\n或者就是在两行文本直接加一个空行。\n\n也能实现换行效果，不过这个行间距有点大。\n###单行文本\n    Hello,大家好，我是果冻虾仁。\n###文本块\n    欢迎到访\n    很高兴见到您\n    祝您，早上好，中午好，下午好，晚安\n###部分文字高亮\nThank `You` . Please `Call` Me `Coder`\n####高亮功能更适合做一篇文章的tag\n例如:<br>\n`java` `网络编程` `Socket` `全双工`\n####删除线\n这是一个 ~~删除线~~\n####斜体\n*斜体1*\n\n_斜体2_\n####粗体\n**粗体1**\n\n__粗体2__\n\n####组合使用粗体、斜体和删除线\n***斜粗体1***\n\n___斜粗体2___\n\n***~~斜粗体删除线1~~***\n\n~~***斜粗体删除线2***~~\n\n##<a name=\"link\"/>链接\n###链接外部URL\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")   语法如下：\n```\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")\n```\n###链接的另一种写法\n[我的博客][id]  \n\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"   \n语法如下：\n```\n[我的博客][id]\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"\n```\n中括号[ ]里的id，可以是数字，字母等的组合。这两行可以不连着写，**一般把第二行的链接统一放在文章末尾**，id上下对应就行了。这样正文看起来会比较干净。\n\n###链接本仓库里的URL\n[Book](./Book)\n语法如下：\n```\n[Book](./Book)\n```\n如果文件要引用的文件不存在，则待点击的文本为红色。引用的文件存在存在则文本为蓝色。\n###锚点\n我们可以使用HTML的锚点标签（`#`）来设置锚点：[回到目录](#index)  \n但其实呢，每一个标题都是一个锚点，不需要用标签来指定，比如我们 [回到顶部](#TEST)\n不过不幸的是，由于对中文支持的不好，所以中文标题貌似是不能视作标签的。\n\n##<a name=\"pic\"/>显示图片\n###来源于网络的图片\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\")\n![](https://assets-cdn.github.com/images/modules/contact/goldstar.gif)\n\n###GitHub仓库中的图片\n![](https://github.com/guodongxiaren/ImageCache/raw/master/Logo/foryou.gif)\n###<a name=\"piclink\">给图片加上超链接\n####第一种\n\n[![head]](http://blog.csdn.net/guodongxiaren/article/details/23690801)\n[head]:https://github.com/guodongxiaren/ImageCache/raw/master/Logo/jianxin.jpg \"点击图片进入我的博客\"\n\n#### 第二种\n[![内容任意](http://www.baidu.com/img/bdlogo.gif \"百度logo\")](http://www.baidu.com)\n\n\n\n\n##<a name=\"dot\"/>列表\n###圆点列表\n* 昵称：果冻虾仁\n* 别名：隔壁老王\n* 英文名：Jelly\n\n###更多圆点\n* 编程语言\n    * 脚本语言\n        * Python\n\n###数字列表\n####一般效果\n就是在数字后面加一个点，再加一个空格。不过看起来起来可能不够明显。    \n面向对象的三个基本特征：\n\n1. 封装\n2. 继承\n3. 多态\n\n####数字列表自动排序\n也可以在第一行指定`1. `，而接下来的几行用星号`*`（或者继续用数字1. ）就可以了，它会自动显示成2、3、4……。    \n面向对象的七大原则：\n\n1. 开闭原则\n* 里氏转换原则\n* 依赖倒转原则\n* 接口隔离原则\n* 组合/聚合复用原则\n* “迪米特”法则\n* 单一直则原则\n\n####多级数字列表\n和圆点的列表一样，数字列表也有多级结构：  \n\n1. 这是一级的数字列表，数字1还是1\n   1. 这是二级的数字列表，阿拉伯数字在显示的时候变成了罗马数字\n      1. 这是三级的数字列表，数字在显示的时候变成了英文字母\n\t    1. 四级的数字列表显示效果，就不再变化了，依旧是英文字母\n\n### 复选框列表\n- [x] C\n- [x] C++\n- [x] Java\n- [x] Qt\n- [x] Android\n- [ ] C#\n- [ ] .NET\n\n您可以使用这个功能来标注某个项目各项任务的完成情况。\n##<a name=\"blockquotes\"/>块引用\n\n###常用于引用文本\n####文本摘自《深入理解计算机系统》P27\n　令人吃惊的是，在哪种字节顺序是合适的这个问题上，人们表现得非常情绪化。实际上术语“little endian”（小端）和“big endian”（大端）出自Jonathan Swift的《格利佛游记》一书，其中交战的两个派别无法就应该从哪一端打开一个半熟的鸡蛋达成一致。因此，争论沦为关于社会政治的争论。只要选择了一种规则并且始终如一的坚持，其实对于哪种字节排序的选择都是任意的。\n><b>“端”（endian）的起源</b><br>\n以下是Jonathan Swift在1726年关于大小端之争历史的描述：<br>\n“……下面我要告诉你的是，Lilliput和Blefuscu这两大强国在过去36个月里一直在苦战。战争开始是由于以下的原因：我们大家都认为，吃鸡蛋前，原始的方法是打破鸡蛋较大的一端，可是当今的皇帝的祖父小时候吃鸡蛋，一次按古法打鸡蛋时碰巧将一个手指弄破了，因此他的父亲，当时的皇帝，就下了一道敕令，命令全体臣民吃鸡蛋时打破较小的一端，违令者重罚。”\n\n###块引用有多级结构\n>数据结构\n>>树\n>>>二叉树\n>>>>平衡二叉树\n>>>>>满二叉树\n\n##<a name=\"code\"/>代码高亮\n```Java\npublic static void main(String[]args){} //Java\n```\n```c\nint main(int argc, char *argv[]) //C\n```\n```Bash\necho \"hello GitHub\"#Bash\n```\n```javascript\ndocument.getElementById(\"myH1\").innerHTML=\"Welcome to my Homepage\"; //javascipt\n```\n```cpp\nstring &operator+(const string& A,const string& B) //cpp\n```\n##<a name=\"table\"/>显示表格\n表头1  | 表头2\n------------- | -------------\nContent Cell  | Content Cell\nContent Cell  | Content Cell\n\n| 表头1  | 表头2|\n| ------------- | ------------- |\n| Content Cell  | Content Cell  |\n| Content Cell  | Content Cell  |\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | Display the help window.|\n| Close     | Closes a window     |\n\n表格中也可以使用普通文本的删除线，斜体等效果\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | ~~Display the~~ help window.|\n| Close     | _Closes_ a window     |\n\n表格可以指定对齐方式\n\n| 左对齐 | 居中  | 右对齐 |\n| :------------ |:---------------:| -----:|\n| col 3 is      | some wordy text | $1600 |\n| col 2 is      | centered        |   $12 |\n| zebra stripes | are neat        |    $1 |\n\n表格中嵌入图片\n\n| 图片 | 描述 |\n| ---- | ---- |\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\") | baidu\n\n##<a name=\"emoji\"/>添加表情\nGithub的Markdown语法支持添加emoji表情，输入不同的符号码（两个冒号包围的字符）可以显示出不同的表情。\n\n比如`:blush:`，可以显示:blush:。\n\n具体每一个表情的符号码，可以查询GitHub的官方网页[http://www.emoji-cheat-sheet.com](http://www.emoji-cheat-sheet.com)。\n\n但是这个网页每次都打开**奇慢**。。所以我整理到了本repo中，大家可以直接在此查看[emoji](./emoji.md)。','content','title6',1461279635,'2016-04-22',1463279635,'2016-04-22','vimkid',1,'',0,'seotitle','keywords','description',0,'vimkid website',1,'seosubtitle',0,999,NULL,NULL,0,0),(7,1,1,'README\n===========================\n该文件用来测试和展示书写README的各种markdown语法。GitHub的markdown语法在标准的markdown语法基础上做了扩充，称之为`GitHub Flavored Markdown`。简称`GFM`，GFM在GitHub上有广泛应用，除了README文件外，issues和wiki均支持markdown语法。\n\n****\n###　　　　　　　　　　　　Author:Jelly\n###　　　　　　　　　 E-mail:879231132@qq.com\n\n===========================\n\n\n\n##<a name=\"index\"/>目录\n* [横线](#line)\n* [标题](#title)\n* [文本](#text)\n    * 普通文本\n    * 单行文本\n    * 多行文本\n    * 文字高亮\n* [链接](#link) \n    * 文字超链接\n        *  链接外部URL\n        *  链接本仓库里的URL\n    *  锚点\n    * [图片超链接](#piclink)\n* [图片](#pic)\n    * 来源于网络的图片\n    * GitHub仓库中的图片\n* [列表](#dot)\n    * 圆点列表\n    * 数字列表\n    * 复选框列表\n* [块引用](#blockquotes)\n* [代码](#code)\n* [表格](#table) \n* [表情](#emoji)\n\n<a name=\"line\"/>\n##***、---、___显示虚横线\n***\n---\n___\n\n\n\n<a name=\"title\"/>\n#一级标题\n##二级标题\n###三级标题\n####四级标题\n#####五级标题\n######六级标题\n\n\n##<a name=\"text\"/>显示文本\n###普通文本\n这是一段普通的文本\n####关于换行\n直接回车不能换行，<br>\n可以使用<br>。\n但是使用html标签就丧失了markdown的意义。  \n可以在上一行文本后面补两个空格，  \n这样下一行的文本就换行了。\n\n或者就是在两行文本直接加一个空行。\n\n也能实现换行效果，不过这个行间距有点大。\n###单行文本\n    Hello,大家好，我是果冻虾仁。\n###文本块\n    欢迎到访\n    很高兴见到您\n    祝您，早上好，中午好，下午好，晚安\n###部分文字高亮\nThank `You` . Please `Call` Me `Coder`\n####高亮功能更适合做一篇文章的tag\n例如:<br>\n`java` `网络编程` `Socket` `全双工`\n####删除线\n这是一个 ~~删除线~~\n####斜体\n*斜体1*\n\n_斜体2_\n####粗体\n**粗体1**\n\n__粗体2__\n\n####组合使用粗体、斜体和删除线\n***斜粗体1***\n\n___斜粗体2___\n\n***~~斜粗体删除线1~~***\n\n~~***斜粗体删除线2***~~\n\n##<a name=\"link\"/>链接\n###链接外部URL\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")   语法如下：\n```\n[我的博客](http://blog.csdn.net/guodongxiaren \"悬停显示\")\n```\n###链接的另一种写法\n[我的博客][id]  \n\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"   \n语法如下：\n```\n[我的博客][id]\n[id]:http://blog.csdn.net/guodongxiaren \"悬停显示\"\n```\n中括号[ ]里的id，可以是数字，字母等的组合。这两行可以不连着写，**一般把第二行的链接统一放在文章末尾**，id上下对应就行了。这样正文看起来会比较干净。\n\n###链接本仓库里的URL\n[Book](./Book)\n语法如下：\n```\n[Book](./Book)\n```\n如果文件要引用的文件不存在，则待点击的文本为红色。引用的文件存在存在则文本为蓝色。\n###锚点\n我们可以使用HTML的锚点标签（`#`）来设置锚点：[回到目录](#index)  \n但其实呢，每一个标题都是一个锚点，不需要用标签来指定，比如我们 [回到顶部](#TEST)\n不过不幸的是，由于对中文支持的不好，所以中文标题貌似是不能视作标签的。\n\n##<a name=\"pic\"/>显示图片\n###来源于网络的图片\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\")\n![](https://assets-cdn.github.com/images/modules/contact/goldstar.gif)\n\n###GitHub仓库中的图片\n![](https://github.com/guodongxiaren/ImageCache/raw/master/Logo/foryou.gif)\n###<a name=\"piclink\">给图片加上超链接\n####第一种\n\n[![head]](http://blog.csdn.net/guodongxiaren/article/details/23690801)\n[head]:https://github.com/guodongxiaren/ImageCache/raw/master/Logo/jianxin.jpg \"点击图片进入我的博客\"\n\n#### 第二种\n[![内容任意](http://www.baidu.com/img/bdlogo.gif \"百度logo\")](http://www.baidu.com)\n\n\n\n\n##<a name=\"dot\"/>列表\n###圆点列表\n* 昵称：果冻虾仁\n* 别名：隔壁老王\n* 英文名：Jelly\n\n###更多圆点\n* 编程语言\n    * 脚本语言\n        * Python\n\n###数字列表\n####一般效果\n就是在数字后面加一个点，再加一个空格。不过看起来起来可能不够明显。    \n面向对象的三个基本特征：\n\n1. 封装\n2. 继承\n3. 多态\n\n####数字列表自动排序\n也可以在第一行指定`1. `，而接下来的几行用星号`*`（或者继续用数字1. ）就可以了，它会自动显示成2、3、4……。    \n面向对象的七大原则：\n\n1. 开闭原则\n* 里氏转换原则\n* 依赖倒转原则\n* 接口隔离原则\n* 组合/聚合复用原则\n* “迪米特”法则\n* 单一直则原则\n\n####多级数字列表\n和圆点的列表一样，数字列表也有多级结构：  \n\n1. 这是一级的数字列表，数字1还是1\n   1. 这是二级的数字列表，阿拉伯数字在显示的时候变成了罗马数字\n      1. 这是三级的数字列表，数字在显示的时候变成了英文字母\n\t    1. 四级的数字列表显示效果，就不再变化了，依旧是英文字母\n\n### 复选框列表\n- [x] C\n- [x] C++\n- [x] Java\n- [x] Qt\n- [x] Android\n- [ ] C#\n- [ ] .NET\n\n您可以使用这个功能来标注某个项目各项任务的完成情况。\n##<a name=\"blockquotes\"/>块引用\n\n###常用于引用文本\n####文本摘自《深入理解计算机系统》P27\n　令人吃惊的是，在哪种字节顺序是合适的这个问题上，人们表现得非常情绪化。实际上术语“little endian”（小端）和“big endian”（大端）出自Jonathan Swift的《格利佛游记》一书，其中交战的两个派别无法就应该从哪一端打开一个半熟的鸡蛋达成一致。因此，争论沦为关于社会政治的争论。只要选择了一种规则并且始终如一的坚持，其实对于哪种字节排序的选择都是任意的。\n><b>“端”（endian）的起源</b><br>\n以下是Jonathan Swift在1726年关于大小端之争历史的描述：<br>\n“……下面我要告诉你的是，Lilliput和Blefuscu这两大强国在过去36个月里一直在苦战。战争开始是由于以下的原因：我们大家都认为，吃鸡蛋前，原始的方法是打破鸡蛋较大的一端，可是当今的皇帝的祖父小时候吃鸡蛋，一次按古法打鸡蛋时碰巧将一个手指弄破了，因此他的父亲，当时的皇帝，就下了一道敕令，命令全体臣民吃鸡蛋时打破较小的一端，违令者重罚。”\n\n###块引用有多级结构\n>数据结构\n>>树\n>>>二叉树\n>>>>平衡二叉树\n>>>>>满二叉树\n\n##<a name=\"code\"/>代码高亮\n```Java\npublic static void main(String[]args){} //Java\n```\n```c\nint main(int argc, char *argv[]) //C\n```\n```Bash\necho \"hello GitHub\"#Bash\n```\n```javascript\ndocument.getElementById(\"myH1\").innerHTML=\"Welcome to my Homepage\"; //javascipt\n```\n```cpp\nstring &operator+(const string& A,const string& B) //cpp\n```\n##<a name=\"table\"/>显示表格\n表头1  | 表头2\n------------- | -------------\nContent Cell  | Content Cell\nContent Cell  | Content Cell\n\n| 表头1  | 表头2|\n| ------------- | ------------- |\n| Content Cell  | Content Cell  |\n| Content Cell  | Content Cell  |\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | Display the help window.|\n| Close     | Closes a window     |\n\n表格中也可以使用普通文本的删除线，斜体等效果\n\n| 名字 | 描述          |\n| ------------- | ----------- |\n| Help      | ~~Display the~~ help window.|\n| Close     | _Closes_ a window     |\n\n表格可以指定对齐方式\n\n| 左对齐 | 居中  | 右对齐 |\n| :------------ |:---------------:| -----:|\n| col 3 is      | some wordy text | $1600 |\n| col 2 is      | centered        |   $12 |\n| zebra stripes | are neat        |    $1 |\n\n表格中嵌入图片\n\n| 图片 | 描述 |\n| ---- | ---- |\n![baidu](http://www.baidu.com/img/bdlogo.gif \"百度logo\") | baidu\n\n##<a name=\"emoji\"/>添加表情\nGithub的Markdown语法支持添加emoji表情，输入不同的符号码（两个冒号包围的字符）可以显示出不同的表情。\n\n比如`:blush:`，可以显示:blush:。\n\n具体每一个表情的符号码，可以查询GitHub的官方网页[http://www.emoji-cheat-sheet.com](http://www.emoji-cheat-sheet.com)。\n\n但是这个网页每次都打开**奇慢**。。所以我整理到了本repo中，大家可以直接在此查看[emoji](./emoji.md)。','content','title6',1463279636,'2016-05-15',1463279636,'2016-05-15','vimkid',1,'',0,'seotitle','keywords','description',0,'vimkid website',1,'seosubtitle',0,999,NULL,NULL,0,0);
